import React, { useState, useEffect } from 'react'
import "./RowPost.css"
import { API_KEY, imageUrl } from '../../constants/constants';
import axios from 'axios'

function RowPost() {
  const [movieRow, setMovieRow] = useState([]);
  useEffect(() => {
    axios.get(`movie/popular?api_key=${API_KEY}`).then((Response) => {
      setMovieRow(Response.data)
    })
  }, [])
  return (

    <div className='row'>
      <h2>Netflix Original</h2>
      <div className="posters">
          {
            movieRow.map((obj)=>{
              return(
                <img src={`${imageUrl +ob.backdrop_path}`} alt="image" className='poster' />
              )
            })
          }       
     </div>
    </div>
  )}

export default RowPost
